INSERT INTO `ccphl_article` VALUES ('2', '5ab5c58e-7240-428c-85ba-414ae6d1ee40', '1', '1', '4', '3', '', '小伙巴西基督像自拍 网友：不恐高就是任性', null, null, '为民服务站', 'fushuai', '', null, '', null, null, null, '', '摘要：【小伙巴西基督像自拍 网友：不恐高就是任性】巴西里约热内卢基督像被称为世界新七大奇迹之一，它位于710米高的耶稣山山顶。因此，想要与其拍照合影有一定的难度。为了不留遗憾，拍到合照，巴西一名27岁摄影师攀登上了这座基督像顶，用自拍相机拍摄了与基督像的合影。  …', '', '', '', '25', null, '0', '0', '0', '0', '0', '99', '1', '0', '1', '1', '2015-03-19 14:58:04', null, '2015-08-28 18:51:23');
INSERT INTO `ccphl_article_attach` VALUES ('3', '5b4e528a-990c-4592-912f-038eb411e10e', '3', '1', '2', 'helper.zip', '/upload/wmfw/201503/25/helper.zip', '154004', 'zip', '0', '0', '2015-03-25 13:42:18');
INSERT INTO `ccphl_article_content` VALUES ('3', '7c49d789-f06b-40d8-8e5a-dd4562335dcf', '1', '1', '<p align=\"left\" style=\"font-family:宋体, \'Arial Narrow\', HELVETICA;font-size:14px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b>猪朋狗友斗雷公</b> \r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	一对原本在黑山相爱的狗妖，男的因为要救母亲脱离无间地狱之苦，决要得道成仙，女的为了跟随爱郎，亦随他修道成仙；结果，男狗妖成为二郎神身边的哮天犬（<a target=\"_blank\" href=\"http://baike.baidu.com/view/129388.htm\"><i>李宗翰</i></a><i>饰</i>），而女狗妖就是皇黑娘娘座前的西施犬—相思仙子（<a target=\"_blank\" href=\"http://baike.baidu.com/view/4981.htm\"><i>韩雪</i></a><i>饰</i>）。他们虽然早在黑山时已经相恋，但真正惊天地、泣鬼神的爱情故事，却在他们成仙之后才开始。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	雷震子（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/69797/6365306.htm\"><i>赵毅</i></a><i>饰</i>）疾恶如仇，于天庭专师除妖伏魔，唯雷公除魔越多，戾气越重，为收服二郎神（<a target=\"_blank\" href=\"http://baike.baidu.com/view/1034141.htm\"><i>钟超</i></a><i>饰</i>），将他轰得只余第三只眼。哮天犬回天庭请罪，被罚戍守天庭。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	结果雷公被封神王，意气风发，功高震主。为求灭妖，莽顾老百姓生死，连猪八戒也被雷公轰毙，结果八戒（<a target=\"_blank\" href=\"http://baike.baidu.com/view/582288.htm\"><i>高泓贤</i></a><i>饰</i>）与阎王告上天庭，雷公死不悔改，误打误碰间，被八戒及哮天犬战胜，被逼进入佛灯修行。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	哮天犬&nbsp;<a class=\"lemma-album layout-right nslog:10000206\" href=\"http://baike.baidu.com/picture/189422/189422/16884661/f11f3a292df5e0fe2e5162075f6034a85edf726f.html?fr=lemma&amp;ct=cover\" target=\"_blank\"> \r\n	<div class=\"album-wrap\" style=\"border:1px solid #E0E0E0;\">\r\n		<img class=\"picture\" alt=\"剧照\" src=\"http://h.hiphotos.baidu.com/baike/s%3D220/sign=070a14b666380cd7e21ea5ef9145ad14/f11f3a292df5e0fe2e5162075f6034a85edf726f.jpg\" style=\"width:220px;height:178px;\" /> \r\n	</div>\r\n	<div class=\"description\" style=\"padding:8px 7px;color:#555555;font-size:12px;font-family:simSun;\">\r\n		剧照<span class=\"number\" style=\"color:#808080;\">(42张)</span> \r\n	</div>\r\n	<div class=\"albumBg\" style=\"margin:0px auto;\">\r\n		<div class=\"albumBgFir\" style=\"margin:0px auto;\">\r\n		</div>\r\n		<div class=\"albumBgSec\" style=\"margin:0px auto;\">\r\n		</div>\r\n	</div>\r\n</a>有功，连升三级，戍守北天门。犬与相思恩爱，惹来皇母娘娘侄女琼花仙子（<a target=\"_blank\" href=\"http://baike.baidu.com/view/4611700.htm\"><i>田家伊</i></a><i>饰</i>）的妒忌，相思被设计陷害，险些误杀皇母，幸得犬向玉帝（<a target=\"_blank\" href=\"http://baike.baidu.com/view/4046.htm\"><i>黄海冰</i></a><i>饰</i>）求情，被免死罪，却要眨下凡间。相思求犬一同下凡，不要再做神仙，但犬为了要救娘亲；及履行对玉帝不杀相思的诺言，忍痛拒绝相思，而相思以为犬无情，心痛异常。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	八戒同情相思，要助她与犬一起，于雷音寺偷佛灯，救相思，一起下凡到黑山，要利用手上的佛灯，照出犬昔日的臭皮囊，让他回到囊中，让相思和犬相宿相栖。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	八戒与相思来到黑山，碰到黑山万人迷黑山老邪（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/784391/6007326.htm\"><i>胡东</i></a><i>饰</i>），老邪迷倒黑山万千少女，谁不知却被相思所迷。相思为逃避老邪的小妖所缠，误将佛灯打破，释放被封在灯内的雷公，八戒更完全不知匆忙间取错了封印雷公的佛灯，相思以为大件事，怎知雷公变得只有六岁智商，呼唤相思作娘亲。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	八戒于黑山碰到只在夜间出现，专为将死之人达成愿望的雪女（<a target=\"_blank\" href=\"http://baike.baidu.com/view/468660.htm\"><i>杨旻娜</i></a><i>饰</i>），二人种下情根。黑山老邪为夺取相思的芳心，找阴阳老叟（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/725162/6655597.htm\"><i>董波</i></a><i>饰</i>），想利用逆天轮回到从前，改变这时，结果现实不能改变，老邪赔上了青春，也使得自己与雪女同属一体，故此，日间只见老邪，夜间方能看见雪女。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	同时，哮天犬接受玉帝之命下凡缉拿相思、八戒、雷公等人，犬利用苦肉计擒下雷公，再狠心将相思轰碎，希望以此瞒过玉帝，再把握时间，将相思重生。一切似乎非常顺利，就在犬要将相思重生之际，老邪以为犬对相思不利，插上一手，结果令相思错过重生的机会。老邪大为内疚，不顾自己的生命再次推动逆天轮，抖转时空，改变命运，令相思重生，但老邪赔上的代价，是他的生命。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	老邪与雪女同为一体，老邪油尽灯枯之时，亦即雪女香消玉殒之时，结果八戒终于带雪女上黑山，在她死前，完成她看黑山日出之梦。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	玉帝派四大金刚下凡捉了相思，犬与八戒上天庭救相思，结果演变成大闹天庭。玉帝大怒，为雷公解除封印，利用雷公对付犬三人。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	雷公被解封，回复本来智商，却忘记了与相思的一段母子情，相思不知就里，以为”母子“ 重逢，怎知就被雷公轰成重伤，哮天犬与八戒大怒，猪朋狗友斗雷公。但猪朋狗友的力量与雷公相差甚远，他们根本不是对手。雷公最后再战猪朋狗友，能阻止雷公的方法，是重伤的相思能否唤回雷公那六岁的回忆。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b>情迷女儿国</b> \r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	女儿国全是女人，但她们是一群特殊的女人，一群没有爱情的女人，她们绝对不会爱上任何一个男人，因为她们的情丝被抽走了。女儿国的城门就是大名鼎鼎的美人关，只要是男人哪怕他是神仙，要想闯关进入女儿国，就会马上变成石头，需要百年才能变回原身。女儿国的女子天生具有一种神奇的魅力，男人只需看她们一眼就会染上情毒，一见钟情。身中情毒的男人如果得不到对方的爱情，不久便会心碎而死。因为她们没有情丝，不知男女之爱，所以绝对不会对任何一个男人产生爱情。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	天庭的七公主铁扫（<a target=\"_blank\" href=\"http://baike.baidu.com/view/4252.htm\"><i>章艳敏</i></a><i>饰</i>）暗恋猪八戒已久，为了获得猪八戒的爱情，铁扫决定去偷下界女儿国的愿望水。据《最后一页》提供的可靠情报，神奇的愿望水可以使爱情梦想成真。铁扫在偷水过程中邂逅女儿国国王金枝玉叶（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/590635/6531356.htm\"><i>吴晓敏</i></a><i>饰</i>）并与之结为好友，与此同时，铁扫发现这里的女人很特殊。猪八戒非常渴望能参加三百年一次的蟠桃大会，但苦于没有请柬，铁扫出奇招帮他赢到一张本属于哼哈二将的请柬。哼哈二嫂为了替老公夺回请柬，暗算猪八戒，骗他误闯女儿国，在美人关下身中魔法变成了一块石头。铁扫巧施妙计，借金枝玉叶之手解开了魔法，重新变回人的猪八戒却金枝玉叶一见钟情，深陷情网不能自拔，但这并非真正的爱情，而是中了情毒。如果猪八戒不能得到金枝玉叶的爱情，很快就会心碎而死，但此刻的金枝玉叶根本不知道何谓男女之爱。猪八戒邂逅了一个同样身中情毒的蛤蟆精（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/1000972/10979188.htm\"><i>刘潇潇</i></a><i>饰</i>），他也是刚从一块石头变回来，不过，他变成石头已经整整一百年了。哈蟆精暗恋女儿国的大长老红梅傲雪（<a target=\"_blank\" href=\"http://baike.baidu.com/view/50204.htm\"><i>金巧巧</i></a><i>饰</i>）长达数百年，曾三次勇闯美人关三次变成石头。因为共同的目标使他们结为好友，联手追求心中的爱人，却差点再次变成石头。为了见到朝思暮想的金枝玉叶，猪八戒宁愿变成女人。在一个宝葫芦的帮助下，猪八戒变成了铁扫的姐姐铁琴公主（<a target=\"_blank\" href=\"http://baike.baidu.com/view/35410.htm\"><i>谢娜</i></a><i>饰</i>）。铁扫打听到忘情丹可以解开猪八戒的情毒，于是便跟猪八戒合力把忘情丹从红梅傲雪手中抢走。然而，神丹到手猪八戒却不肯服用，因为忘情丹的副作用很大，一旦服下，从此将会再也没有任何情感。玉皇大帝私自下凡幽会红梅傲雪遭到冷遇，猪八戒等人无意中发现了一个重大秘密，原来女儿国的女子被人抽走了情丝，所以才不知男女之情为何物。于是，几个人怀着各自的目的展开了找回情丝的行动。铁扫要救猪八戒的命，金枝玉叶要拿回属于她们自己的东西，哈蟆精除了要替红梅傲雪找回情丝，还要找玉帝报仇，以消“夺妻之恨”。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	情丝是被玉帝的母亲老王母抽走的。当年，玉帝与红梅傲雪真心相爱，但为老王母所不容，玉帝以放弃帝位相威胁，老王母一怒之下暗中将她们的情丝抽走，让她们从此失去男女之爱。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	蛤蟆精混入天庭，武力劫持王母大闹天庭最终被擒获。玉帝恳请老太后发还情丝遭到拒绝，同时误以为自己服食了忘情丹将失去爱的记忆。为了保留对红梅傲雪的情感，玉帝不惜与深陷囹圄的蛤蟆精换身，变成玉帝的蛤蟆精与太后展开激烈的抗争。铁扫和猪八戒终于发现情丝被锁在一片冰树林中，他们用尽一切办法都没能融化冰树林。此时，猪八戒已经危在旦夕，命悬一线。铁扫为了拯救猪八戒，毅然将自己的情丝献出给了金枝玉叶。猪八戒得到了金枝玉叶的爱情幸免一死，这一刻，猪八戒却突然悟到，自己真正爱的人是铁扫，但铁扫因为失去了情丝已经变成了无情的人。玉帝对红梅傲雪的真心之火融化了冰树林，情丝终于发还给了女儿国，使她们重新变成了有情人。猪八戒也趁机拿回铁扫的情丝，赶去还给铁扫，中途不慎摔倒，情丝被一棵野花吸走。就在猪八戒痛心不已之际，菩萨现身告诉猪八戒，铁扫经受住了考验，已经修炼成佛。失意万分的猪八戒只好揣着那棵情丝野花伤心而去。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b>搬山记</b> \r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	猪八戒在天庭屡次犯错，终于被摘了神仙牌，贬到地界当土地公。对猪八戒怀恨的哼哈二将暗中捣鬼，将猪八戒发配到妖怪猖獗，环境恶劣的乌山。猪八戒神仙功力全失，只有土地拐和仙袍两件逃命的仙器。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	乌山山妖泛滥，致使山体日益膨胀。以鬼虎为首的一帮山妖吃了土地公，肆意危害周遍百姓。柳树村受苦最甚，无以聊生，遂派使者前往世代移山的愚公村求救，因路途必经乌山，使者中途遭山妖阻挠夭折，多年来，无一人到达愚公村。此番，柳树村请了七武士再次护送使者出发，人马途径乌山遭到山妖袭击死伤惨重。村民小齐（<i><a target=\"_blank\" href=\"http://baike.baidu.com/view/5425956.htm\">李澎</a></i><i>饰</i>）得到野猪公子（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/228572/9373838.htm\"><i>徐震</i></a><i>饰</i>）的救助，只身逃离来到愚公村。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	愚公一族其实早有移走乌山的计划，只等愚公十八代练就一身好本事。小齐到来，愚公一族召开誓师大会准备向乌山进发。希望（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/19455/5554721.htm\"><i>陈龙</i></a><i>饰</i>）众望所归被推举为移山领袖。老一代愚公不醉（<a target=\"_blank\" href=\"http://baike.baidu.com/view/122778.htm\"><i>刘德一</i></a><i>饰</i>），因当年移山时醉酒，造成愚公兄弟受损，从小训练女儿不喝（<i><a target=\"_blank\" href=\"http://baike.baidu.com/view/35268.htm\">薛佳凝</a></i><i>饰</i>）探山脉本领，并且把她当男孩养，为的就是让不喝参加移山队为自己立功补过。不醉不惜作弊终于让不喝当上了移山先锋官。移走乌山必须先砍断山脉，作为探山脉专家的不喝深知自己责任重大，但她天生胆小，先行出发后信心不足，不醉一直暗中保护。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	愚公一族挺进乌山。众妖迎战。希望凭借祖传能降妖锄魔的开山斧击退鬼虎（<i>张坚利 饰</i>），首战告捷。不喝被同伴戏弄，与队伍背道而驰，巧遇走马上任的猪八戒。不喝抢了猪八戒的仙袍赶回乌山，正遇以蒲公英（<a target=\"_blank\" href=\"http://baike.baidu.com/view/468660.htm\">杨旻娜</a>饰）为首的花妖迷惑愚公一族，不喝及时救险，愚公一族逃过一劫。花妖虽败，蒲公英却对希望一见钟情。乌山山妖商议，惟有夺取开山斧才能取胜。蒲公英请战去偷开山斧。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	蒲公英只身潜入愚公一族营地，施魔法控制不喝的手拿到开山斧。恰在此时，猪八戒来讨要仙袍，混乱中，开山斧被不喝扔下山崖，不喝和猪八戒一起落难逃跑。山妖趁势偷袭愚公一族，不醉等愚公一族人被俘。希望等人被“好心”的野猪公子搭救，藏于野猪洞。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	猪八戒从不喝处得知愚公一族要移走乌山，大感意外，作为新上任的土地公怎能袖手旁观。猪八戒夸口要降伏山妖还乌山太平。猪八戒带不喝找到土地庙，摇响震山铃召集山妖开会，却被鬼虎派去的小妖修理一顿。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	乌山山妖怀疑野猪公子吃里爬外，窝藏逃犯。为证实真伪，蒲公英向树王献计，自己变成假开山斧，设法混进愚公一族残部，将其一网打尽并可清除内奸。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	为了把假戏做真，他们要利用新任土地公猪八戒。蒲公英向猪八戒赔罪，全部罪过都是鬼虎所为，请求猪八戒保乌山太平。只要他能主持公道，开山斧可以归还愚公一族，双方化干戈为玉帛。猪八戒重拾颜面自然欢天喜地，满口答应，遂按蒲公英所说地点拿到“开山斧”。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	野猪公子救人有功，轻易取得愚公一族的信任。得知猪八戒拿到开山斧，野猪公子借向猪八戒谄媚之际，用炸弹将猪八戒和不喝炸飞，不喝因披着猪八戒的仙袍幸免一死，猪八戒的两件仙器全部损坏。野猪公子拿回“开山斧”交还希望。夜深人静时，蒲公英用“遁梦法”进入希望梦境，让希望对自己萌生爱意。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	猪八戒和不喝落难，猪八戒知道不喝原来是女孩，两人感情有所发展。不喝意外找到乌山山脉，同时发现了一个更大的秘密——野猪公子正和被困山体内部的父亲策划一场惊天阴谋。蒲公英不但俘获了希望的心，还将愚公一族引向更大的陷阱。希望得知“开山斧”原来是蒲公英所变，愚公一族正在走向危险。为了找回开山斧完成移山大任，他忍辱负重向山妖诈降，及时将愚公一族救出危险境地。希望进入乌山妖穴并假装和蒲公英“相好”。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	猪八戒和不喝和愚公一族汇合。不喝鼓动大家士气，继续寻找开山斧，不移乌山，誓不回头。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	鬼虎为了试探希望，命他喝下妖血，为了完成移山大业，希望舍生取义喝下妖血。在没有完全变成妖怪之前，他必须将开山斧交给愚公一族。蒲公英其实早已看出希望不爱自己，但为了这短暂的虚妄的美好的爱情，她甘愿长梦不醒。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b>无法无天无间盗</b> \r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	佛祖成佛后，七情六欲被驱之念外，形成一个无形体的妖。自称无法无天（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/66545/8668707.htm\"><i>徐锦江</i></a><i>饰</i>）。他怨恨佛祖的铁石心肠，恨佛祖的心静无波澜。恨佛祖的正气与意志独占本仍和七情六欲共有的肉身。无法无天决定报复佛祖，决定夺回肉身。因他与佛祖本为同生，又同在菩提树悟道成神。因此无法无天也俱备佛祖的力量，但是亘古以来，邪不胜正，无法无天心杂志乱，屡败于佛祖之后，决定找到传说中关有八十一个妖精的魔盒和开盒的咒语。他为此残杀生灵，不惜放一场瘟疫以逼一个国王交出开魔盒的咒语，佛祖事先洞澈无法无天的意图，派降龙（<a target=\"_blank\" href=\"http://baike.baidu.com/view/52431.htm\"><i>安琥</i></a><i>饰</i>）伏虎（<a target=\"_blank\" href=\"http://baike.baidu.com/view/1539561.htm\"><i>寇占文</i></a><i>饰</i>）罗汉下界收服无法无天。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	降龙伏虎一个暴力，一个胆小，一个豪迈，一个小气。天生合作不到一块儿，一路上，伏虎的哭哭啼啼婆婆妈妈，让降龙心烦意乱。好在在无法无天拿到咒语之前，降龙伏虎及时赶到，化成龙虎金刚，将无法无天打得七情涣散。而咒语也与一个新生的胎儿合一，要想再度取出咒语，除非用这个胎儿当祭品，由于降龙伏虎二人意见无法统一，导致无法无天的逃走，同时降龙的身上中了无法无天的绿毒。无法重回西天极乐，佛祖认为二人心不诚佛不专，让二人回尘世托生，重新悟道。不料，降龙最怕的事情又发生了，伏虎居然托生到他家的隔壁，而与咒语合二为一的胎儿也同时出生了。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	猪八戒因为土地神作的好，受到了天上的赏识，派太白金星（<a target=\"_blank\" href=\"http://baike.baidu.com/view/3552538.htm\"><i>金粮</i></a><i>饰</i>）下界送来高升的委任状。告知猪八戒被提升为龙虎山的山神，猪八戒欢天喜地的要去上任时，太白金星却告诉他山神的委任状已经给一伙强盗抢走了，叫猪八戒自己找回来。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	猪八戒刚到龙虎山就被无间盗抢的精光，还被暴扁一顿，委屈之余想回到山神庙里，发出山神已经被一个孩子占领，因为猪八戒被打了消法针，使不出法术，导致人见人欺，最后被小龙关进一口箱子里面。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	无间盗是一伙死后不能下地狱，活着又不能转世的一些人，因此他们有了不死之身，这些人聚集在一起成了强盗。领头的强盗叫朱逢春（<a target=\"_blank\" href=\"http://baike.baidu.com/view/582288.htm\"><i>高泓贤</i></a><i>饰</i>）。他有一个老婆叫小蝶（<a target=\"_blank\" href=\"http://baike.baidu.com/view/302289.htm\"><i>张丹露</i></a><i>饰</i>），而朱逢春就是当年猪八戒的主人。因为猪八戒占用了朱逢春的肉身，以至于朱逢春永世不得超生，因为地狱里没有他的死亡记录，朱逢春一直不知道是谁害了他，当猪八戒来到龙虎山时，朱逢春终于知道让他在黄泉路上徘徊居然就是他当年宠爱的小猪，朱逢春决定抓住小猪，报仇血恨。同时，小蝶打听到妖界四大蠢带着一个箱子经过龙虎山，并听说这四个人手中有一个魔盒，这个魔盒可以满足所有人的愿望。于是这伙无间盗决定从妖界四大蠢的手中抢回魔盒，但他们却不知道妖界四大蠢抬的那口箱子里面装着还没有复原的无法无天的”精神“，朱逢春与小蝶带着无间盗们用计想偷到妖界四大蠢的宝贝时，朱逢春被无法无天吃掉，从此无法无天以朱逢春的样貌行走人间，无间盗们却把被小龙关在箱子里的猪八戒抬走。因为猪八戒与朱逢春长得一模一样，以至于小蝶把猪八戒当成朱逢春，恰逢无间盗们造反，小蝶与猪八戒差点给这些造反的人害死，好在猪八戒诡计多端，猪八戒带小蝶逃出的贼巢，猪八戒在与小蝶流亡的过程中了解到了曾经的主人朱逢春所遭遇的一切，为了拯救朱逢春灵魂，猪八戒带着小蝶开始了一系列的计划。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	无法无天只差最后一个山根就会恢复原来的功力，不料龙虎山的山神猪八戒却不见了，以至于他无法拿到龙虎山的山根，因此他也千方百计的要找到龙虎山的山神猪八戒。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	当年转世重生的降龙伏虎与和咒语合二为一的小月（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/939138/5134949.htm\"><i>陈婷</i></a><i>饰</i>）也在龙虎山生活着，此时小龙成了龙虎山的小霸王，伏虎则是山一庙里的和尚，而小月却一直深爱着小龙。正当无法无天不可一事地在龙虎山威风的时候，突然发现降龙伏虎也在这里，当年，他就是被降龙伏虎打得粉碎。此时，狭路相逢，无法无天变得胆小如鼠，见到小龙就跑。而猪八戒与小蝶了解到想拯救朱逢春，除非得到佛的眼泪。为了找到佛的眼泪猪八戒历经千辛万苦，最后得知只有让降龙伏虎成佛，朱逢春才有转世的希望。\r\n</div>\r\n<div class=\"para\" style=\"color:#333333;margin:15px 0px 5px;font-family:arial, 宋体, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	于是猪八戒到处找着降龙伏虎的化身，无法无天则气急败坏地找龙虎山的山神猪八戒，完成最后一关，可他偏偏又被小龙小虎紧紧缠着不放。在这个古怪而又好笑的循环当中，又有无间盗们插科打诨笑料百出。一个新的故事由此展开。[4]<a name=\"ref_[4]_189422\"></a>&nbsp;\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<p align=\"left\" style=\"font-family:宋体, \'Arial Narrow\', HELVETICA;font-size:14px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>');
